            <h1>Who we are</h1>

            <p>We are passionate about California and preserving the abundant resources that make it so unique. Our goal at Explore California is to transform your vacation into an adventure that will educate, inspire, and energize you unlike any other.</p><img src=""/images/mission_look.jpg"" style=""float: right; padding: 1em 0 10em 1em;"">
